import Head from 'next/head';
import Nav from './Nav';

function Layout({ children }) {
  return (
    <div className='container'>
      <Head>
        <title>Digital Library</title>
        <meta name='viewport' content='initial-scale=1.0, width=device-width' />
      </Head>
      <body>
        <Nav />
        {children}
      </body>
    </div>
  );
}

export default Layout;
